B.Kl=A.a(s(["F\xfcr k=0, d.h. ohne Gegenkopplung, ist die Kennlinie sehr steil (hohe Verst\xe4rkung), aber auch stark nichtlinear, was auf gro\xdfe Verzerrungen hindeutet.","F\xfcr gr\xf6\xdfer werdendes k nimmt die Steigung der Kennlinie und damit auch die Verst\xe4rkung ab. Gleichzeitig verringert sich aber auch die Nichtlinearit\xe4t der Kennlinie. Gegenkopplung bewirkt also eine Abnahme der Verst\xe4rkung, aber auch einen R\xfcckgang der Verzerrungen.","Aus der Gleichung f\xfcr A folgt, dass f\xfcr hinreichend gro\xdfe Werte von a*k, der so genannten Schleifenverst\xe4rkung, die Gesamtverst\xe4rkung in A=1/k \xfcbergeht. Gegenkopplung bewirkt somit, dass die Gesamtverst\xe4rkung A nicht mehr von den Verst\xe4rkereigenschaften a, sondern nur noch von dem Gegenkopplungsnetzwerk k abh\xe4ngig ist.","Nimmt die Schleifenverst\xe4rkung a*k den Wert -1 an, so geht der Ausdruck f\xfcr A gegen unendlich. In diesem Fall schwingt der r\xfcckgekoppelte Verst\xe4rker. Da dies in der Regel nicht erw\xfcnscht ist (Ausnahme: Oszillator), stellt sich die Frage, wie sich Kriterien f\xfcr die Stabilit\xe4t einer gegengekoppelten Verst\xe4rkerschaltung angeben lassen."]),t.s)
